import React from 'react'
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Autocomplete from './components/Autocomplete'



import logo from './logo.svg';
import './App.css';

function App() {

  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Autocomplete></Autocomplete>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
